package traing.prob451;

import java.util.ArrayList;

public class Solution {
    public String frequencySort(String s) {
        int[] frequency = new int[256];

        for (char c : s.toCharArray()) {
            int value = (int) c;
            if (frequency[value] == 0) {
                frequency[value] = 1;
            } else {
                frequency[value] = frequency[value] + 1;
            }
        }

        ArrayList<String> cList = new ArrayList<>(s.length());

        String result = "";
        for (int i = 0; i < s.length() + 1; i++) {
            cList.add(null);
        }

//        for (int i = 0; i < freequency.length; i++) {
//            System.out.print( i + ": " + freequency[i] + ", ");
//        }
//        System.out.println();

        for (int i = 0; i < frequency.length; i++) {
            int free = frequency[i];
            if (free == 0) {
                continue;
            }
            for (int j = 0; j < free; j++) {
                result += (char) i;
            }
            if (cList.get(free) != null) {
                result += cList.get(free);
            }
            cList.set(free, result);
            result = "";
        }
//        System.out.println(cList);
        for (int i = cList.size() - 1; i >= 0; i--) {
            if (cList.get(i) != null) {
                result += cList.get(i);
            }
        }

        return result;
    }

    public static void main(String[] args) {
        final Solution s = new Solution();
        System.out.println(s.frequencySort(""));
//        System.out.println((int)'A');
    }
}
